import Forja from '../mains/forja.png';
import Animalandia from '../mains/animalandia.jpg';
import Steam from '../mains/steam.png';
import '../mains/Mains.css';

function Mains(){
    return(
        <main className='mains'>
            <div className="slider-index">
                <section id="slider">
                    <input type="radio" name="slider" id="slide1" checked></input>
                    <input type="radio" name="slider" id="slide2"></input>
                    <input type="radio" name="slider" id="slide3"></input>
                    <input type="radio" name="slider" id="slide4"></input>
                    <input type="radio" name="slider" id="slide5"></input>

                    
                </section>
            </div>
        </main>
    );
}
export default Mains;
